/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `create_activity_post`(
  IN travel_str varchar(100),
  IN user_id int, 
  IN msg_id int,
  IN stat_msg varchar(80))
run:BEGIN
	DECLARE 	post_id				int;
	DECLARE		b_time, f_time, exp_time	datetime;
#	DECLARE 	res_line, res_stop, res_id	INT DEFAULT 0;
	DECLARE		res_id                          int default 0; 
   DECLARE      res_stop                        varchar(256);
	DECLARE		post, opt_link, res_final			varchar(254);
	DECLARE 	no_more_rows			boolean;
	
DECLARE station_cur CURSOR FOR
/*	SELECT 	a.id, a.line, s.s_name, f.s_name */
   SELECT 	concat(s.s_name, "@", a.line, ":", a.id), a.id
	FROM 	activities a, stations s
	WHERE 	a.user_id 	= user_id
	AND 	a.message_id 	= msg_id
	AND 	a.line		= s.line
	AND	a.s_stop	= s.s_seq
#	AND 	a.expiry	> NOW()

   ORDER BY a.s_time desc
;

DECLARE CONTINUE HANDLER FOR NOT FOUND
	Set no_more_rows = true;

/*set opt_link = '';*/

cursor_sect: begin
  OPEN station_cur;

   FETCH station_cur INTO res_stop, res_id;
	IF no_more_rows THEN
	  CLOSE station_cur;
     LEAVE cursor_sect;
	END IF;

   select distinct s.s_name into res_final
   from stations s, activities a
   where a.id = res_id
   and s.s_code = a.final_stop
   limit 1
;

   set opt_link = concat(res_stop, "-", res_final ); 
   
loop_sect: LOOP
     FETCH station_cur INTO res_stop, res_id;
     IF no_more_rows THEN
       CLOSE station_cur;
		 LEAVE loop_sect;
     END IF; 
     set opt_link = concat(res_stop, "-", opt_link );
END LOOP loop_sect;
end cursor_sect;



if stat_msg is null then
	set post = concat('< No Subj > \n\n Est.Time: ', travel_str, ' \n \n -- updated by Trainfinder (click links below for details)');
else
	set post = concat(stat_msg, ' \n\n Est.Time: ', travel_str, ' \n \n -- updated by Trainfinder (click links below for details)');
end if;

	select 		min(a.s_time),
			max(a.e_time),
			max(a.expiry)
	INTO		b_time, f_time, exp_time
	from 		activities a
	where		a.user_id	= user_id
	and		a.message_id	= msg_id
	limit 1;


	insert into microposts (content, user_id, created_at, updated_at, 
					message_id, s_time, e_time, expire_at, opt_link )
	values(	substr(post,1,254),  
		user_id, NOW(), NOW(),
		msg_id, b_time, f_time, exp_time, opt_link );


END */;;
DELIMITER ;
