/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `find_arrival_times`(
  IN path_str varchar(50),
  IN begin_time DATETIME,
/*  IN isWeekend bool, */ 
  IN isLog_dB bool,
  IN user_id int, 
  IN msg_id int,
  IN stat_msg varchar(80))
run:BEGIN

	DECLARE 	e_stop, s_stop, final_dest				char(4);	
	DECLARE 	path_len,start_pos,word_len,step_size,code_len,updated_rows	int;
	DECLARE		depart_tm, arrive_tm, s_time				char(5);
	DECLARE		train_no						char(6);
	DECLARE		res							varchar(80);
	DECLARE		isWeekend						bool;

	if weekday(begin_time) > 5 then
		set isWeekend = false;
	else
		set isWeekend = true;
	end if;
	set word_len	= 9;
	set step_size	= 5;
	set code_len	= 4;
	set start_pos	= 0;

	select length(path_str) into path_len;
	set final_dest 	= substr(path_str, path_len - code_len + 1, code_len);
	set s_time	= DATE_FORMAT(begin_time,'%H:%i');
	set res		= '';

	while (start_pos+word_len <= path_len) do
		set s_stop 	= substr(path_str, start_pos+1, code_len);
		set start_pos 	= start_pos + step_size;
		set e_stop 	= substr(path_str, start_pos+1, code_len);
		call find_train_time(s_stop, e_stop, s_time, isWeekend, 
					isLog_dB, user_id, msg_id, final_dest, stat_msg,
					train_no, depart_tm, arrive_tm	);

		if train_no is null then
			select 'No train match to the conditions or time near midnight' as res, -1 as updated_rows;
			leave run;
		end if;
		set res 	= concat(res,s_stop,'(',depart_tm,')-');
		set s_time	= arrive_tm;
	end while;

	set res = concat(res,e_stop,'(',arrive_tm,')');


		/* obtain the start time (hh:mm) of the journey e.g ASHV(hh:mm)-xxxx(xx:xx) */

	if isLog_dB then
		set s_time = substr(res,6,5);
		call update_existing_activity(user_id,s_time,arrive_tm,msg_id, updated_rows);
		call create_activity_post(res, user_id, msg_id, stat_msg);
	else
		set updated_rows = 0;
	end if;

	select res as res, updated_rows as updated_rows;

END */;;
DELIMITER ;
