/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `find_train_time`(
  IN s_stop CHAR(4), 
  IN e_stop CHAR(4), 
  IN begin_time char(5), 
  IN isWeekend BOOL,

  IN isLog_dB BOOL,
  IN user_id INT,
  IN msg_id INT,
  IN final_dest char(5),
  IN stat_msg varchar(80),

  out train_no char(6),
  out depart_tm char(5),
  out arrive_tm char(5)
)
run:BEGIN
declare 	line, dir, s_seq, e_seq		smallint;

	select		src.line,
			src.train_no,
			src.train_dir,
			src.stop_time,
			dest.stop_time	
	into		line,
			train_no,
			dir,
			depart_tm,
			arrive_tm
	from 	train_time src, train_time dest
	where
		src.s_code	= s_stop
	and	dest.s_code	= e_stop
	and	src.stop_time 	> begin_time 
	and 	src.line	= dest.line
	and 	src.train_no 	= dest.train_no
	and 	src.train_dir	= dest.train_dir
	and 	(src.line, src.train_dir) in (
		select		b.line,
				if(isWeekend, 
					if(b.s_seq<e.s_seq, 6, 5),
					if(b.s_seq<e.s_seq, 1, 0)  ) as train_dir
		from		stations b, stations e
		where		b.s_code 	= s_stop
		and 		e.s_code 	= e_stop
 		and		b.line		= e.line
)
order by dest.stop_time, src.stop_time desc
limit 1;

if NOT isLog_dB then
	leave run;
end if;	

select	s.s_seq,
	e.s_seq
into 	s_seq,
	e_seq
from	stations s, stations e
where	s.s_code 	= s_stop
and	e.s_code 	= e_stop
and	s.line 		= line
and 	e.line		= line;


call add_activity ( user_id, line, dir, s_seq, e_seq, final_dest,depart_tm, arrive_tm, 
				msg_id, train_no, stat_msg);

END */;;
DELIMITER ;
