/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `find_travel_path`(
  IN stop_1 char(4),
  IN stop_2 char(4),
  IN stop_3 char(4),
  IN stop_4 char(4),
  IN stop_5 char(4)
 )
BEGIN

  DECLARE 	res, tmp				varchar(50);

  call plot_connect_stops_code(stop_1,stop_2,tmp);

  set res = concat(stop_1,tmp);

run: begin

  if stop_3 is null then
	leave run;
  end if;
  call plot_connect_stops_code(stop_2,stop_3,tmp);
  set res = concat(res, tmp);

  if stop_4 is null then
	leave run;
  end if;
  call plot_connect_stops_code(stop_3,stop_4,tmp);
  set res = concat(res, tmp);

  if stop_5 is null then
	leave run;
  end if;
  call plot_connect_stops_code(stop_4, stop_5, tmp);
  set res = concat(res, tmp);

end run;

  select res;

END */;;
