/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `find_travel_path_old`(IN path_str varchar(50) )
BEGIN
  DECLARE 	s_stop, e_stop 				char(4);	
  DECLARE 	path_len, start_pos, word_len, step_size, code_len  int;
  DECLARE 	res, tmp				varchar(50);

	set code_len	= 4;
	set word_len	= 9;
	set step_size	= 5;

	set start_pos	= 0;
	set res 	= substr(path_str,start_pos+1,code_len);

	select length(path_str) into path_len;


	while (start_pos+word_len <= path_len) do
		set s_stop = substr(path_str, start_pos+1, code_len);
		set start_pos = start_pos + step_size;
		set e_stop = substr(path_str, start_pos+1, code_len);
		call plot_connect_stops_code(s_stop,e_stop,tmp);
		set res = concat(res, tmp);
	end while;
	select res;

END */;;
DELIMITER ;
