	and	o.train_no	= oq.train_no
	and	abs(aq.seq-oq.seq) < 	proxmity
	group by o.user_id
	order by dist, o.s_time
);	

insert into broadcasts (user_id, ref_msg, status, bc_content, created_at, updated_at) (
	select 	o.user_id,
			msg_id,
