				if(m.dist<0,
					concat(m.dist,' ',s.s_code,'(',substr(a.s_time,12,5),')-',e.s_code,'(',substr(a.e_time,12,5),')'),
			    	concat('+',m.dist,' ',s.s_code,'(',substr(a.s_time,12,5),')-',e.s_code,'(',substr(a.e_time,12,5),')'))
