/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `plot_connect_stops_code`(IN s_stop varchar(25), 
  IN e_stop varchar(25), 
  OUT routes varchar(50)  )
search:BEGIN


 /* chk if s_stop and e_stop are in the same line*/
	select  '1' into  routes
	from	stations s, stations e
	where 
		s.s_code 	= s_stop
	and	e.s_code 	= e_stop 
	and 	s.line		= e.line
	limit 	1;

	if routes is not null then
		select concat('-',e_stop) into routes;
		leave search;
	end if; 

  	select 		concat( '-', i.stops ,'-', dest.s_code) into routes 
	from 		interchanges 	as i
	inner join 	stations 	as src 	on src.line=i.from_line
	inner join 	stations 	as dest on dest.line=i.to_line
	where		src.s_code 	= s_stop
	and		dest.s_code 	= e_stop 
	order by 	abs(src.s_seq - i.from_seq) + abs(dest.s_seq-i.to_seq) + i.cost ,i.cost, abs(src.s_seq - i.from_seq) 
	limit 1;

END */;;
DELIMITER ;
