/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `to_json_id_name_alias`(
	IN 	user_id		int,
	IN	search		varchar(254))
BEGIN
DECLARE		skey		varchar(254);
	set	skey = concat("%", search, "%");

	select	u.id as id,
		concat(u.name, ' - ', u.login) as name
	from	users u
	where	u.name like skey
   or    u.login like skey
    
union
	select	f.friend_id as id,
             concat(s.name, '- (', f.alias_name, ')') as name
	from	relationships f, users s
	where	f.user_id = user_id
	and	f.alias_name like skey
	and	f.friend_id = s.id
;
END */;;
DELIMITER ;
