/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `to_web_activity_opt_links`(
	IN	opt_links 	varchar(254),
	IN	link_params	varchar(254)
)
BEGIN
DECLARE		opt_len, idx_old, idx 		int;
DECLARE		res  				varchar(1024);


	set opt_len = length(opt_links);
/*	set idx_old = 1;   assumed there always be one element*/
	set idx = locate(' ', opt_links); /* assume all id ends with space, even if it is last*/

	select concat(s.s_name, 
			" - (<a class=\"train_line line",
			s.line,
			"\" href=\"/trainbuddy/activities/",
			a.id,
			link_params,
			"\"> stops </a>) -> ",
			e.s_name) into res
	from 	activities a, stations s, stations e
	where	a.id = substr(opt_links, 1, idx - 1)
	and	a.line		= s.line
	and	a.line		= e.line
	and	a.s_stop	= s.s_seq
	and	a.e_stop	= e.s_seq;
		
	set idx_old = idx + 1;
	set idx = locate(' ', opt_links, idx+1);

	while(idx <> 0) do
		select concat( 	res,
				" - (<a class=\"train_line line",
				e.line,
				"\" href=\"/trainbuddy/activities/",
				a.id,
				link_params,
				"\"> stops </a>) -> ",
				e.s_name) into res
		from	activities a, stations e
		where	a.id 		= substr(opt_links, idx_old, idx - idx_old)
		and	a.line 		= e.line
		and	a.e_stop	= e.s_seq;

		set	idx_old = idx + 1;
		set 	idx 	= locate(' ', opt_links, idx +1 );		
	end while;

	select res; 

END */;;
DELIMITER ;
