/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `update_existing_activity`(
	IN user_id int,
	IN s_time char(5),
	IN e_time char(5),
	IN msg_id int,
	OUT res int )
BEGIN
 	update activities a
	set a.expiry = current_timestamp, updated_at = current_timestamp, status = 1
	where	a.user_id 	= user_id
	and	a.expiry 	> current_timestamp
	and	a.status 	= 0
	and 	a.message_id	<> msg_id
	and	( 
		   (	a.s_time >= timestamp(concat(curdate(),' ',s_time)) and a.s_time <= timestamp(concat(curdate(),' ',e_time)) )
		OR (	a.e_time <= timestamp(concat(curdate(),' ',e_time)) and a.e_time >= timestamp(concat(curdate(),' ',s_time)) )
		);
	select ROW_COUNT() into res;

	update microposts a
	set 	a.expire_at = NOW(), 
		content = concat('EXPIRED : ', left(content,length(content)-53), 'updated by Post Corrector') 
	where	a.user_id	= user_id
	and	a.expire_at	> current_timestamp
	and	a.message_id 	is not NULL
	and 	a.message_id 	<> msg_id  /* update the post with old message*/
	and	( 
		   (	a.s_time >= timestamp(concat(curdate(),' ',s_time)) and a.s_time <= timestamp(concat(curdate(),' ',e_time)) )
		OR (	a.e_time <= timestamp(concat(curdate(),' ',e_time)) and a.e_time >= timestamp(concat(curdate(),' ',s_time)) )
		);	

	
END */;;
DELIMITER ;
